import React from 'react'
import Button from '@mui/material/Button';
import DeleteIcon from '@mui/icons-material/Delete';

function ChildNote(props) {
  return (
    <>
      <div className='cnote'>
        <h1>{props.title}</h1>
        <p>{props.content}</p>
        <Button className='cnotebtn'>
            <DeleteIcon />
        </Button>
      </div>
    </>
  )
}

export default ChildNote;
